// HomePage.js
import React from 'react';
import videoBg from "./components/background.mp4";
import yourSvg from './components/HomePage.svg';

const HomePage = () => {
  return (
    <div style={{ position: 'relative', width: '100vw', height: '100vh', overflow: 'hidden' }}>
      {/* Video */}
      <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', objectFit: 'cover' }}>
        <source src={videoBg} type="video/mp4"></source>
      </video>

      {/* SVG */}
      <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}>
        <img src={yourSvg} alt="Your SVG" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />

        {/* Links */}
        <a href="/consent" style={{ position: 'absolute', top: '4.5%', left: '91.6%', transform: 'translate(-50%, -50%)', color: 'white', textDecoration: 'none', padding: '30px 55px',  borderRadius: '10px'}}> </a>
        <a href="/consent" style={{ position: 'absolute', top: '64.4%', left: '49.95%', transform: 'translate(-50%, -50%)', color: 'white', textDecoration: 'none', padding: '30px 55px',  borderRadius: '10px'}}> </a>
      </div>
    </div>
  );
};

export default HomePage;
